import React from 'react';

const About=()=> {
  return (
    <div>
      <h1>Mi perfil</h1>
      {/* <img src="tu-imagen.jpg" alt="Tu imagen" /> */}
      <p>Nombre: Federico</p>
      <p>Edad: 39</p>
      <p>Descripción: Soy un estudiante de informática apasionado por la tecnología y la innovación. Me encanta explorar nuevas herramientas y lenguajes de programación, y estoy constantemente buscando formas de mejorar mis habilidades en el desarrollo de software. Tengo un fuerte interés en áreas como la inteligencia artificial, la ciberseguridad y la programación web, y estoy decidido a convertirme en un experto en estas áreas.

       En mi tiempo libre, disfruto programando proyectos personales y contribuyendo a proyectos de código abierto. Soy un miembro activo de la comunidad de tecnología y asisto regularmente a eventos y conferencias para aprender y compartir conocimientos con mis colegas. Mi objetivo a largo plazo es convertirme en un desarrollador líder en la industria tecnológica y tener un impacto significativo en la forma en que las personas interactúan con la tecnología en su vida diaria.</p>
    </div>
  );
}

export default About;
